{
    "openapi": "3.0.0",
    "info": {
      "title": "RecruitHub API",
      "description": "API documentation for RecruitHub",
      "version": "1.0.0"
    },
    "servers": [
      {
        "url": "http://localhost:8000/api",
        "description": "Local development server"
      }
    ],
    "components": {
      "securitySchemes": {
        "bearerAuth": {
          "type": "http",
          "scheme": "bearer",
          "bearerFormat": "JWT",
          "description": "Enter your bearer token in the format **Bearer {token}**",
          "value": "API_KEY=cde7ac9e2f9b7950690b0b44c031309591de0ae033976d762c1b220c02b4614b"
        }
      },
      "schemas": {
        "AssignedByDto": {
          "type": "object",
          "required": ["employeeId", "name", "emailId"],
          "properties": {
            "employeeId": {
              "type": "string",
              "description": "Employee ID of the person who assigned",
              "example": "EMP002"
            },
            "name": {
              "type": "string",
              "description": "Name of the person who assigned",
              "example": "Admin User"
            },
            "emailId": {
              "type": "string",
              "format": "email",
              "description": "Email of the person who assigned",
              "example": "admin@company.com"
            }
          }
        },
        "CreateAssignmentDto": {
          "type": "object",
          "required": [
            "studentId",
            "studentName",
            "registrationNumber",
            "emailId",
            "collegeId",
            "collegeName",
            "driveId",
            "driveName",
            "panelId",
            "primaryPanelMember",
            "roundNumber",
            "assignedBy",
            "assignedTimestamp"
          ],
          "properties": {
            "assignmentId": {
              "type": "string",
              "format": "uuid",
              "description": "Unique identifier for the assignment (auto-generated if not provided)",
              "example": "123e4567-e89b-12d3-a456-426614174000"
            },
            "studentId": {
              "type": "string",
              "format": "uuid",
              "description": "ID of the student",
              "example": "123e4567-e89b-12d3-a456-426614174000"
            },
            "studentName": {
              "type": "string",
              "description": "Name of the student",
              "example": "John Doe"
            },
            "registrationNumber": {
              "type": "string",
              "description": "Registration number of the student",
              "example": "REG123"
            },
            "emailId": {
              "type": "string",
              "format": "email",
              "description": "Email of the student",
              "example": "john@example.com"
            },
            "collegeId": {
              "type": "string",
              "format": "uuid",
              "description": "ID of the college",
              "example": "123e4567-e89b-12d3-a456-426614174000"
            },
            "collegeName": {
              "type": "string",
              "description": "Name of the college",
              "example": "Example College"
            },
            "driveId": {
              "type": "string",
              "format": "uuid",
              "description": "ID of the drive",
              "example": "123e4567-e89b-12d3-a456-426614174000"
            },
            "driveName": {
              "type": "string",
              "description": "Name of the drive",
              "example": "Summer Internship Drive"
            },
            "panelId": {
              "type": "string",
              "format": "uuid",
              "description": "ID of the panel",
              "example": "123e4567-e89b-12d3-a456-426614174000"
            },
            "primaryPanelMember": {
              "$ref": "#/components/schemas/PanelMemberDto"
            },
            "additionalPanelMembers": {
              "type": "array",
              "description": "List of additional panel members",
              "items": {
                "$ref": "#/components/schemas/PanelMemberDto"
              }
            },
            "roundNumber": {
              "type": "integer",
              "description": "Round number",
              "example": 1
            },
            "assignedBy": {
              "$ref": "#/components/schemas/AssignedByDto"
            },
            "assignedTimestamp": {
              "type": "string",
              "format": "date-time",
              "description": "Timestamp when the assignment was created",
              "example": "2025-03-25T07:00:00.000Z"
            }
          }
        },
        "UpdateAssignmentDto": {
          "type": "object",
          "properties": {
            "panelId": {
              "type": "string",
              "format": "uuid",
              "description": "ID of the panel",
              "example": "123e4567-e89b-12d3-a456-426614174000"
            },
            "primaryPanelMember": {
              "$ref": "#/components/schemas/PanelMemberDto"
            },
            "additionalPanelMembers": {
              "type": "array",
              "description": "List of additional panel members",
              "items": {
                "$ref": "#/components/schemas/PanelMemberDto"
              }
            },
            "roundNumber": {
              "type": "integer",
              "description": "Round number",
              "example": 2
            }
          }
        },
        "Assignment": {
          "type": "object",
          "properties": {
            "assignmentId": {
              "type": "string",
              "format": "uuid",
              "description": "Unique identifier for the assignment",
              "example": "123e4567-e89b-12d3-a456-426614174000"
            },
            "studentId": {
              "type": "string",
              "format": "uuid",
              "description": "ID of the student",
              "example": "123e4567-e89b-12d3-a456-426614174000"
            },
            "studentName": {
              "type": "string",
              "description": "Name of the student",
              "example": "John Doe"
            },
            "registrationNumber": {
              "type": "string",
              "description": "Registration number of the student",
              "example": "REG123"
            },
            "emailId": {
              "type": "string",
              "format": "email",
              "description": "Email of the student",
              "example": "john@example.com"
            },
            "collegeId": {
              "type": "string",
              "format": "uuid",
              "description": "ID of the college",
              "example": "123e4567-e89b-12d3-a456-426614174000"
            },
            "collegeName": {
              "type": "string",
              "description": "Name of the college",
              "example": "Example College"
            },
            "driveId": {
              "type": "string",
              "format": "uuid",
              "description": "ID of the drive",
              "example": "123e4567-e89b-12d3-a456-426614174000"
            },
            "driveName": {
              "type": "string",
              "description": "Name of the drive",
              "example": "Summer Internship Drive"
            },
            "panelId": {
              "type": "string",
              "format": "uuid",
              "description": "ID of the panel",
              "example": "123e4567-e89b-12d3-a456-426614174000"
            },
            "primaryPanelMember": {
              "$ref": "#/components/schemas/PanelMemberDto"
            },
            "additionalPanelMembers": {
              "type": "array",
              "description": "List of additional panel members",
              "items": {
                "$ref": "#/components/schemas/PanelMemberDto"
              }
            },
            "roundNumber": {
              "type": "integer",
              "description": "Round number",
              "example": 1
            },
            "assignedBy": {
              "$ref": "#/components/schemas/AssignedByDto"
            },
            "assignedTimestamp": {
              "type": "string",
              "format": "date-time",
              "description": "Timestamp when the assignment was created",
              "example": "2025-03-25T07:00:00.000Z"
            },
            "isActive": {
              "type": "boolean",
              "description": "Whether the assignment is active",
              "example": true
            },
            "createdAt": {
              "type": "string",
              "format": "date-time",
              "description": "The timestamp when the assignment was created",
              "example": "2025-03-25T07:00:00.000Z"
            },
            "updatedAt": {
              "type": "string",
              "format": "date-time",
              "description": "The timestamp when the assignment was last updated",
              "example": "2025-03-25T07:00:00.000Z"
            }
          }
        },
        "PaginatedAssignmentResponse": {
          "type": "object",
          "properties": {
            "assignments": {
              "type": "array",
              "description": "List of assignments",
              "items": {
                "$ref": "#/components/schemas/Assignment"
              }
            },
            "total": {
              "type": "integer",
              "description": "Total number of assignments",
              "example": 100
            },
            "page": {
              "type": "integer",
              "description": "Current page number",
              "example": 1
            },
            "limit": {
              "type": "integer",
              "description": "Number of items per page",
              "example": 10
            }
          }
        },
        "PanelMemberDto": {
          "type": "object",
          "required": ["employeeId", "emailId", "name"],
          "properties": {
            "employeeId": {
              "type": "string",
              "description": "Employee ID of the panel member",
              "example": "EMP001"
            },
            "emailId": {
              "type": "string",
              "format": "email",
              "description": "Email ID of the panel member",
              "example": "primary@example.com"
            },
            "name": {
              "type": "string",
              "description": "Name of the panel member",
              "example": "John Doe"
            }
          }
        },
        "CreatePanelDto": {
          "type": "object",
          "required": ["primaryPanelMember"],
          "properties": {
            "primaryPanelMember": {
              "$ref": "#/components/schemas/PanelMemberDto"
            },
            "additionalPanelMembers": {
              "type": "array",
              "description": "List of additional panel members",
              "items": {
                "$ref": "#/components/schemas/PanelMemberDto"
              }
            },
            "name": {
              "type": "string",
              "description": "Name of the panel",
              "example": "Test Panel"
            }
          }
        },
        "UpdatePanelDto": {
          "type": "object",
          "properties": {
            "additionalPanelMembers": {
              "type": "array",
              "description": "List of additional panel members",
              "items": {
                "$ref": "#/components/schemas/PanelMemberDto"
              }
            },
            "name": {
              "type": "string",
              "description": "Name of the panel",
              "example": "Updated Test Panel"
            }
          }
        },
        "Panel": {
          "type": "object",
          "properties": {
            "panelId": {
              "type": "string",
              "format": "uuid",
              "description": "Unique identifier for the panel",
              "example": "123e4567-e89b-12d3-a456-426614174000"
            },
            "primaryPanelMember": {
              "$ref": "#/components/schemas/PanelMemberDto"
            },
            "additionalPanelMembers": {
              "type": "array",
              "description": "List of additional panel members",
              "items": {
                "$ref": "#/components/schemas/PanelMemberDto"
              }
            },
            "name": {
              "type": "string",
              "description": "Name of the panel",
              "example": "Test Panel"
            },
            "createdAt": {
              "type": "string",
              "format": "date-time",
              "description": "The timestamp when the panel was created",
              "example": "2025-03-25T07:00:00.000Z"
            },
            "updatedAt": {
              "type": "string",
              "format": "date-time",
              "description": "The timestamp when the panel was last updated",
              "example": "2025-03-25T07:00:00.000Z"
            }
          }
        },
        "EvaluationCriteriaDto": {
          "type": "object",
          "required": ["name", "ratingType"],
          "properties": {
            "criteriaId": {
              "type": "string",
              "format": "uuid",
              "description": "Unique identifier for the evaluation criteria",
              "example": "123e4567-e89b-12d3-a456-426614174000"
            },
            "name": {
              "type": "string",
              "description": "Name of the evaluation criteria",
              "example": "Problem Solving"
            },
            "description": {
              "type": "string",
              "description": "Description of the evaluation criteria",
              "example": "Ability to solve complex problems"
            },
            "ratingType": {
              "type": "string",
              "enum": ["percentage", "scale-5", "scale-10", "yes-no", "text"],
              "description": "Type of rating for this criteria",
              "example": "scale-5"
            },
            "isRequired": {
              "type": "boolean",
              "description": "Whether this criteria is required for evaluation",
              "default": true,
              "example": true
            }
          }
        },
        "RoundDto": {
          "type": "object",
          "required": ["roundNumber", "name", "startTime", "endTime", "evaluationCriteria"],
          "properties": {
            "roundNumber": {
              "type": "integer",
              "description": "The round number (1-5)",
              "minimum": 1,
              "maximum": 5,
              "example": 1
            },
            "name": {
              "type": "string",
              "description": "Name of the round",
              "example": "Technical Round"
            },
            "startTime": {
              "type": "string",
              "format": "date-time",
              "description": "Start time of the round",
              "example": "2025-06-15T09:00:00Z"
            },
            "endTime": {
              "type": "string",
              "format": "date-time",
              "description": "End time of the round",
              "example": "2025-06-15T12:00:00Z"
            },
            "evaluationCriteria": {
              "type": "array",
              "description": "List of evaluation criteria for this round",
              "items": {
                "$ref": "#/components/schemas/EvaluationCriteriaDto"
              },
              "minItems": 1
            }
          }
        },
        "CreateRoundDto": {
          "$ref": "#/components/schemas/RoundDto"
        },
        "UpdateRoundDto": {
          "type": "object",
          "properties": {
            "name": {
              "type": "string",
              "description": "Name of the round",
              "example": "Updated Technical Round"
            },
            "startTime": {
              "type": "string",
              "format": "date-time",
              "description": "Start time of the round",
              "example": "2025-06-15T10:00:00Z"
            },
            "endTime": {
              "type": "string",
              "format": "date-time",
              "description": "End time of the round",
              "example": "2025-06-15T13:00:00Z"
            },
            "evaluationCriteria": {
              "type": "array",
              "description": "List of evaluation criteria for this round",
              "items": {
                "$ref": "#/components/schemas/EvaluationCriteriaDto"
              },
              "minItems": 1
            }
          }
        },
        "SecondarySpocDto": {
          "type": "object",
          "required": ["spocId", "spocEmail", "spocName"],
          "properties": {
            "spocId": {
              "type": "string",
              "format": "uuid",
              "description": "Unique identifier for the SPOC",
              "example": "123e4567-e89b-12d3-a456-426614174000"
            },
            "spocEmail": {
              "type": "string",
              "format": "email",
              "description": "Email of the SPOC",
              "example": "secondary.spoc@example.com"
            },
            "spocName": {
              "type": "string",
              "description": "Name of the SPOC",
              "example": "Jane Smith"
            }
          }
        },
        "CreateDriveDto": {
          "type": "object",
          "required": [
            "name", 
            "collegeId", 
            "collegeName", 
            "role", 
            "practice", 
            "startDate", 
            "primarySpocId", 
            "primarySpocEmail", 
            "primarySpocName"
          ],
          "properties": {
            "name": {
              "type": "string",
              "description": "Name of the drive",
              "example": "Summer 2025 Recruitment Drive"
            },
            "collegeId": {
              "type": "string",
              "format": "uuid",
              "description": "ID of the college",
              "example": "123e4567-e89b-12d3-a456-426614174000"
            },
            "collegeName": {
              "type": "string",
              "description": "Name of the college",
              "example": "Harvard University"
            },
            "role": {
              "type": "string",
              "enum": ["Associate Engineer", "Business Analyst"],
              "description": "Role being recruited for",
              "example": "Associate Engineer"
            },
            "practice": {
              "type": "string",
              "enum": ["Application Development", "DevOps", "PMO", "BaUX"],
              "description": "Practice area",
              "example": "Application Development"
            },
            "startDate": {
              "type": "string",
              "format": "date-time",
              "description": "Start date of the drive",
              "example": "2025-06-15T09:00:00Z"
            },
            "primarySpocId": {
              "type": "string",
              "format": "uuid",
              "description": "ID of the primary SPOC",
              "example": "123e4567-e89b-12d3-a456-426614174000"
            },
            "primarySpocEmail": {
              "type": "string",
              "format": "email",
              "description": "Email of the primary SPOC",
              "example": "primary.spoc@example.com"
            },
            "primarySpocName": {
              "type": "string",
              "description": "Name of the primary SPOC",
              "example": "John Doe"
            },
            "secondarySpocs": {
              "type": "array",
              "description": "List of secondary SPOCs",
              "items": {
                "$ref": "#/components/schemas/SecondarySpocDto"
              },
              "maxItems": 5
            },
            "isPinned": {
              "type": "boolean",
              "description": "Whether the drive is pinned",
              "default": false,
              "example": false
            },
            "isCompleted": {
              "type": "boolean",
              "description": "Whether the drive is completed",
              "default": false,
              "example": false
            },
            "rounds": {
              "type": "array",
              "description": "List of rounds in the drive",
              "items": {
                "$ref": "#/components/schemas/RoundDto"
              },
              "maxItems": 5
            }
          }
        },
        "UpdateDriveDto": {
          "type": "object",
          "properties": {
            "name": {
              "type": "string",
              "description": "Name of the drive",
              "example": "Updated Summer 2025 Recruitment Drive"
            },
            "collegeId": {
              "type": "string",
              "format": "uuid",
              "description": "ID of the college",
              "example": "123e4567-e89b-12d3-a456-426614174000"
            },
            "collegeName": {
              "type": "string",
              "description": "Name of the college",
              "example": "Harvard University"
            },
            "role": {
              "type": "string",
              "enum": ["Associate Engineer", "Business Analyst"],
              "description": "Role being recruited for",
              "example": "Associate Engineer"
            },
            "practice": {
              "type": "string",
              "enum": ["Application Development", "DevOps", "PMO", "BaUX"],
              "description": "Practice area",
              "example": "Application Development"
            },
            "startDate": {
              "type": "string",
              "format": "date-time",
              "description": "Start date of the drive",
              "example": "2025-06-15T09:00:00Z"
            },
            "primarySpocId": {
              "type": "string",
              "format": "uuid",
              "description": "ID of the primary SPOC",
              "example": "123e4567-e89b-12d3-a456-426614174000"
            },
            "primarySpocEmail": {
              "type": "string",
              "format": "email",
              "description": "Email of the primary SPOC",
              "example": "primary.spoc@example.com"
            },
            "primarySpocName": {
              "type": "string",
              "description": "Name of the primary SPOC",
              "example": "John Doe"
            },
            "secondarySpocs": {
              "type": "array",
              "description": "List of secondary SPOCs",
              "items": {
                "$ref": "#/components/schemas/SecondarySpocDto"
              },
              "maxItems": 5
            },
            "isPinned": {
              "type": "boolean",
              "description": "Whether the drive is pinned",
              "example": true
            },
            "isCompleted": {
              "type": "boolean",
              "description": "Whether the drive is completed",
              "example": false
            },
            "rounds": {
              "type": "array",
              "description": "List of rounds in the drive",
              "items": {
                "$ref": "#/components/schemas/RoundDto"
              },
              "maxItems": 5
            }
          }
        },
        "DriveDocument": {
          "type": "object",
          "properties": {
            "driveId": {
              "type": "string",
              "format": "uuid",
              "description": "Unique identifier for the drive",
              "example": "123e4567-e89b-12d3-a456-426614174000"
            },
            "name": {
              "type": "string",
              "description": "Name of the drive",
              "example": "Summer 2025 Recruitment Drive"
            },
            "collegeId": {
              "type": "string",
              "format": "uuid",
              "description": "ID of the college",
              "example": "123e4567-e89b-12d3-a456-426614174000"
            },
            "collegeName": {
              "type": "string",
              "description": "Name of the college",
              "example": "Harvard University"
            },
            "role": {
              "type": "string",
              "enum": ["Associate Engineer", "Business Analyst"],
              "description": "Role being recruited for",
              "example": "Associate Engineer"
            },
            "practice": {
              "type": "string",
              "enum": ["Application Development", "DevOps", "PMO", "BaUX"],
              "description": "Practice area",
              "example": "Application Development"
            },
            "startDate": {
              "type": "string",
              "format": "date-time",
              "description": "Start date of the drive",
              "example": "2025-06-15T09:00:00Z"
            },
            "primarySpocId": {
              "type": "string",
              "format": "uuid",
              "description": "ID of the primary SPOC",
              "example": "123e4567-e89b-12d3-a456-426614174000"
            },
            "primarySpocEmail": {
              "type": "string",
              "format": "email",
              "description": "Email of the primary SPOC",
              "example": "primary.spoc@example.com"
            },
            "primarySpocName": {
              "type": "string",
              "description": "Name of the primary SPOC",
              "example": "John Doe"
            },
            "secondarySpocs": {
              "type": "array",
              "description": "List of secondary SPOCs",
              "items": {
                "$ref": "#/components/schemas/SecondarySpocDto"
              }
            },
            "isPinned": {
              "type": "boolean",
              "description": "Whether the drive is pinned",
              "example": false
            },
            "isCompleted": {
              "type": "boolean",
              "description": "Whether the drive is completed",
              "example": false
            },
            "isActive": {
              "type": "boolean",
              "description": "Whether the drive is active",
              "example": true
            },
            "wecpTestIds": {
              "type": "array",
              "description": "List of WECP test IDs",
              "items": {
                "type": "string"
              }
            },
            "rounds": {
              "type": "array",
              "description": "List of rounds in the drive",
              "items": {
                "$ref": "#/components/schemas/RoundDto"
              }
            },
            "createdTimestamp": {
              "type": "string",
              "format": "date-time",
              "description": "The timestamp when the drive was created",
              "example": "2025-03-25T07:00:00.000Z"
            },
            "updatedTimestamp": {
              "type": "string",
              "format": "date-time",
              "description": "The timestamp when the drive was last updated",
              "example": "2025-03-25T07:00:00.000Z"
            }
          }
        },
        "PaginatedDriveResponse": {
          "type": "object",
          "properties": {
            "drives": {
              "type": "array",
              "description": "List of drives",
              "items": {
                "$ref": "#/components/schemas/DriveDocument"
              }
            },
            "total": {
              "type": "integer",
              "description": "Total number of drives",
              "example": 100
            },
            "page": {
              "type": "integer",
              "description": "Current page number",
              "example": 1
            },
            "limit": {
              "type": "integer",
              "description": "Number of items per page",
              "example": 10
            }
          }
        },
        "CreateCollegeDto": {
          "type": "object",
          "required": ["name", "city"],
          "properties": {
            "name": {
              "type": "string",
              "description": "The name of the college",
              "example": "Harvard University",
              "minLength": 5
            },
            "city": {
